(20, 'PERFIL ESTRUCTURAL ENTREPISO O PLACA FACIL', '<p>Elaborado en acero al carbono laminado en caliente, su presentación es de 6 y 12 m en Negro o Galvanizado.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>', '', NULL, 4, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(21, 'FLEJES PARA CORTINA ENROLLABLE', '<p>Este producto  se puede entregar Negro (CR) o Galvanizado, corriente o estampado, en presentación ancha y angosta. Se fabrica con acero  laminado en frio y lamina acero Galvanizado.</p>\r\n<p>NORMA NTC 103-2-42-ASTM A 653</p>\r\n<p> </p>\r\n<table ', '', NULL, 4, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(22, 'VARILLA CORRUGADA', '<p>Barras de acero circular rectas en cuya superficie es corrugada, obtenidas por la laminación en caliente de palanquilla y de colada continua.</p>\r\n<p><strong>NTC 2289 (ASTM A706/A706M)</strong></p>\r\n<p> </p>\r\n<table class="MsoTableGrid" style', '', NULL, 5, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(23, 'VARILLA REDONDA LISA', '<p>Barras lisas con  sección transversas circular, laminadas en caliente</p>\r\n<p> </p>\r\n<table class="MsoTableGrid" style="border-collapse: collapse; border: none; mso-border-alt: solid windowtext .5pt; mso-yfti-tbllook: 1184; mso-padding-alt: 0', '', NULL, 5, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(24, 'VARILLA CUADRADA', '<p>Barra con sección  transversal cuadrada, laminada en caliente con bajos contenidos  de carbono que garantizan su ductilidad.</p>\r\n<p> </p>\r\n<table class="MsoTableGrid" style="border-collapse: collapse; border: none; mso-border-alt: solid wind', '', NULL, 5, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25, 'MALLAS ELECTROSOLDADAS', '<p>Estructura  de acero liso o grafilado soldado en todos sus puntos de encuentro.</p>\r\n<p><strong>NTC 2310 - 1925.</strong></p>\r\n<p> </p>\r\n<p> </p>\r\n<table class="MsoTableGrid" style="border-collapse: collapse; border: none; mso-border-alt: sol', '', NULL, 6, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27, 'LAMINA Y BOBINA COLD ROLLED', '<p>Chapa laminada en  caliente sometida a un proceso de laminación en frío para reducir su espesor, obtener mayor aptitud al conformado y un mejor espesor superficial.</p>\r\n<p> </p>\r\n<table class="MsoTableGrid" style="border-collapse:collapse;ms', '', NULL, 7, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28, 'TUBERIA ESTRUCTURAL', '<p>Tubería estructural formada en frío a partir de lamina de acero en caliente y soldada por inducción de alta frecuencia. En diferente calidad según su uso.</p>', '', NULL, 2, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29, 'LAMINA ALFAJOR O ESTRIADA ', '<p>Son láminas HR estriadas, con lagrimas o resaltes para pisos industriales. Fabricadas bajo la norma ASTM A-569.</p>', '', NULL, 7, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(30, 'LAMINA HR', '<p>Acero al carbono laminado en caliente (Hot Rolled). Se obtiene a partir de grandes barras de acero, que al pasar por una sucesión de rodillos van reduciendo su espesor hasta lograr laminas de diferentes calibres. El uso según las propiedades ', '', NULL, 7, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31, 'TEJA DE ZINC', '<p>Son láminas acanaladas de acero en presentaciones ondulado o liso muy delgadas con un recubrimiento de zinc o galvanizado que impide su oxidación</p>\r\n<p><strong>Norma NTC: 3238 - ASTM A 924</strong>.</p>\r\n<p> </p>\r\n<p> </p>', '', NULL, 8, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32, 'LAMINA ZINC LISO', '<p>Lamina de acero galvanizada con presentación en rollo, hoja y cinta.</p>\r\n<p>Ofrece con la más efectiva solución contra la corrosión del acero, debido a que suministra una protección catódica (galvánica), una mayor vida útil del producto, ref', '', NULL, 7, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
