(34, 'ALAMBRE GALVANIZADO', '<p>Es un alambre brillante o negro que lleva un recubrimiento de zinc, se fabrica con diferentes capas y diámetros según su uso; es muy resistente a la corrosión es de acero Galvanizado a bajo carbono..</p>', '<!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:RelyOnVML/>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n<p> </p>\r\n<table class="MsoTableGrid" style="border-collapse: collapse; border: none; mso-border-alt: solid windowtext .5pt; mso-yfti-tbllook: 1184; mso-padding-alt: 0cm 5.4pt 0cm 5.4pt;" border="1" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr style="mso-yfti-irow: 0; mso-yfti-firstrow: yes;">\r\n<td style="width: 432.2pt; border: solid windowtext 1.0pt; mso-border-alt: solid windowtext .5pt; padding: 0cm 5.4pt 0cm 5.4pt;" colspan="3" valign="top" width="576">\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: center; line-height: normal;" align="center">ALAMBRE GALVANIZADO</p>\r\n</td>\r\n</tr>\r\n<tr style="mso-yfti-irow: 1;">\r\n<td style="width: 144.05pt; border: solid windowtext 1.0pt; border-top: none; mso-border-top-alt: solid windowtext .5pt; mso-border-alt: solid windowtext .5pt; padding: 0cm 5.4pt 0cm 5.4pt;" valign="top" width="192">\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: center; line-height: normal;" align="center">CALIBRE BWG</p>\r\n</td>\r\n<td style="width: 144.05pt; border-top: none; border-left: none; border-bottom: solid windowtext 1.0pt; border-right: solid windowtext 1.0pt; mso-border-top-alt: solid windowtext .5pt; mso-border-left-alt: solid windowtext .5pt; mso-border-alt: solid windowtext .5pt; padding: 0cm 5.4pt 0cm 5.4pt;" valign="top" width="192">\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: center; line-height: normal;" align="center">DIAMETRO NOMINAL MM</p>\r\n</td>\r\n<td style="width: 144.1pt; border-top: none; border-left: none; border-bottom: solid windowtext 1.0pt; border-righ